import React, { useState, useEffect } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import { Box, TextField, Button, Typography, Link as MuiLink, Paper, Checkbox, FormControlLabel, InputAdornment } from '@mui/material';
import PersonOutlineIcon from '@mui/icons-material/PersonOutline';
import BadgeOutlinedIcon from '@mui/icons-material/BadgeOutlined';
import AccountCircleOutlinedIcon from '@mui/icons-material/AccountCircleOutlined';
import EmailOutlinedIcon from '@mui/icons-material/EmailOutlined';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import VpnKeyOutlinedIcon from '@mui/icons-material/VpnKeyOutlined';
import PhoneIcon from '@mui/icons-material/Phone';

function Register() {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [phone, setPhone] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [agreeTerms, setAgreeTerms] = useState(false);
  const [message, setMessage] = useState('');
  const [error, setError] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const savedData = localStorage.getItem('registerFormData');
    if (savedData) {
      const parsedData = JSON.parse(savedData);
      setFirstName(parsedData.firstName || '');
      setLastName(parsedData.lastName || '');
      setUsername(parsedData.username || '');
      setEmail(parsedData.email || '');
      setPhone(parsedData.phone || '');
    } else {
      setFirstName('Harshith');
      setLastName('Kumar');
      setUsername('harshith.kumar');
      setEmail('harshith.kumar@example.com');
      setPhone('+91 98765 43210');
      setPassword('Harshith123!');
      setConfirmPassword('Harshith123!');
      setAgreeTerms(true);
    }
  }, []);

  const saveFormData = () => {
    const formData = { firstName, lastName, username, email, phone };
    localStorage.setItem('registerFormData', JSON.stringify(formData));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (password !== confirmPassword) { setError("Passwords do not match."); return; }
    if (!agreeTerms) { setError("Please agree to terms and conditions."); return; }
    setError(''); setMessage('');
    try {
      const response = await fetch('http://localhost:3001/register', { 
        method: 'POST', 
        headers: { 'Content-Type': 'application/json' }, 
        body: JSON.stringify({ firstName, lastName, username, email, phone, password }), 
      });
      const data = await response.json(); 
      if (!response.ok) { throw new Error(data.message || 'Failed to register'); }
      localStorage.removeItem('registerFormData');
      setMessage('Registration successful! Redirecting to login...'); 
      setTimeout(() => navigate('/login'), 2000);
    } catch (err) { setError(err.message); }
  };

  return (
    <Paper
      elevation={4}
      sx={{
        position: 'absolute', left: '102px', top: '128px',
        width: '1236px', height: '767px',
        borderRadius: 4, display: 'flex', overflow: 'hidden'
      }}
    >
      <Box sx={{ flex: 1, display: { xs: 'none', md: 'flex' }, alignItems: 'center', justifyContent: 'center', p: 4 }}>
        <Box 
          component="img" 
          src="/R.png" 
          alt="Registration illustration"
          sx={{ maxWidth: '100%', maxHeight: '100%' }}
          onError={(e) => { e.target.style.display = 'none'; }}
        />
      </Box>
      <Box sx={{ flex: 1, p: { xs: 3, md: 5 }, display: 'flex', flexDirection: 'column', justifyContent: 'center' }}>
        <Typography variant="h4" component="h1" sx={{ fontWeight: 'bold', mb: 4 }}>Sign Up</Typography>
        <Box component="form" onSubmit={handleSubmit} autoComplete="on">
          <TextField
            placeholder="Enter First Name" 
            value={firstName} 
            onChange={(e) => { setFirstName(e.target.value); saveFormData(); }}
            name="given-name"
            autoComplete="given-name"
            id="firstName"
            InputProps={{ startAdornment: (<InputAdornment position="start"><PersonOutlineIcon /></InputAdornment>) }}
            required fullWidth sx={{ mb: 2 }}
          />
          <TextField
            placeholder="Enter Last Name" 
            value={lastName} 
            onChange={(e) => { setLastName(e.target.value); saveFormData(); }}
            name="family-name"
            autoComplete="family-name"
            id="lastName"
            InputProps={{ startAdornment: (<InputAdornment position="start"><BadgeOutlinedIcon /></InputAdornment>) }}
            required fullWidth sx={{ mb: 2 }}
          />
          <TextField
            placeholder="Enter Username" 
            value={username} 
            onChange={(e) => { setUsername(e.target.value); saveFormData(); }}
            name="username"
            autoComplete="username"
            id="username"
            InputProps={{ startAdornment: (<InputAdornment position="start"><AccountCircleOutlinedIcon /></InputAdornment>) }}
            required fullWidth sx={{ mb: 2 }}
          />
          <TextField
            placeholder="Enter Email" 
            type="email" 
            value={email} 
            onChange={(e) => { setEmail(e.target.value); saveFormData(); }}
            name="email"
            autoComplete="email"
            id="email"
            InputProps={{ startAdornment: (<InputAdornment position="start"><EmailOutlinedIcon /></InputAdornment>) }}
            required fullWidth sx={{ mb: 2 }}
          />
          <TextField
            placeholder="Enter Phone Number" 
            type="tel" 
            value={phone} 
            onChange={(e) => { setPhone(e.target.value); saveFormData(); }}
            name="tel"
            autoComplete="tel"
            id="phone"
            InputProps={{ startAdornment: (<InputAdornment position="start"><PhoneIcon /></InputAdornment>) }}
            required fullWidth sx={{ mb: 2 }}
          />
          <TextField
            placeholder="Enter Password" 
            type="password" 
            value={password} 
            onChange={(e) => setPassword(e.target.value)}
            name="new-password"
            autoComplete="new-password"
            id="password"
            InputProps={{ startAdornment: (<InputAdornment position="start"><LockOutlinedIcon /></InputAdornment>) }}
            required fullWidth sx={{ mb: 2 }}
          />
          <TextField
            placeholder="Confirm Password" 
            type="password" 
            value={confirmPassword} 
            onChange={(e) => setConfirmPassword(e.target.value)}
            name="new-password"
            autoComplete="new-password"
            id="confirmPassword"
            InputProps={{ startAdornment: (<InputAdornment position="start"><VpnKeyOutlinedIcon /></InputAdornment>) }}
            required fullWidth sx={{ mb: 2 }}
          />
          <FormControlLabel 
            control={
              <Checkbox 
                checked={agreeTerms}
                onChange={(e) => setAgreeTerms(e.target.checked)}
              />
            } 
            label="I agree to all terms" 
            sx={{ mt: 2, mb: 2, color: 'text.secondary' }} 
            required 
          />
          <Button type="submit" variant="contained" color="primary" size="large" fullWidth>Register</Button>
        </Box>
        {message && <Typography color="success.main" sx={{ mt: 2, textAlign: 'center' }}>{message}</Typography>}
        {error && <Typography color="error" sx={{ mt: 2, textAlign: 'center' }}>{error}</Typography>}
        <Typography sx={{ mt: 3, textAlign: 'center', color: 'text.secondary' }}>
          Already have an account? <MuiLink component={Link} to="/login" color="secondary" sx={{ fontWeight: 'bold' }}>Sign In</MuiLink>
        </Typography>
      </Box>
    </Paper>
  );
}

export default Register;
